query:
/*+ NoMergeJoin(mi_idx t) */ select count(*)
from movie_info_idx AS mi_idx
inner join title AS t
on t.id = mi_idx.movie_id AND mi_idx.info_type_id > 100 AND t.kind_id < 7 AND t.production_year = 1950
inner join movie_companies AS mc
on t.id = mc.movie_id AND mc.company_id < 10583 AND mc.company_type_id = 1;
